import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function newNote() {
return (
    <Note 
        key={notes.id}
        title={notes.title}
        content={notes.content}
    />
    );
}

function App(){

return <div>
    <Header/>
    <div>

    {notes.map(newNote)}
    </div>
    <Footer/>
</div>
}

export default App;
